import React, {Component} from 'react';
import "./index.css"

export default class Header extends Component {
    ReloadPages = () =>{
        window.location.reload()
    }
    render() {
        return (
            <div   className={"HeaderStyle"}>
                <h2 onClick={this.ReloadPages} >HOOKS</h2>
            </div>
        );
    }
}
